export const slotCol = `[{
        "title": "line",
        "dataIndex": "action",
        "width": "100px"
      }, {
        "title": "Name",
        "dataIndex": "name",
        "width": "100px"
      }, {
        "title": "Age",
        "dataIndex": "age",
        "width": "100px"
      }, {
        "title": "Address",
        "dataIndex": "address"
      }]`;

export const slotColArray = JSON.parse(slotCol);

export const slotOptions = `[{
        "name": "John Brown",
        "age": "32",
        "address": "New York No. 1 Lake Park",
        "action": "delete"
      }, {
        "name": "Jim Green",
        "age": "42",
        "address": "London No. 1 Lake Park",
        "action": "add"
      }, {
        "name": "Joe Black",
        "age": "32",
        "address": "Sidney No. 1 Lake Park",
        "action": "delete"
      }]`;

export const slotOptionsArray = JSON.parse(slotOptions);
